import React from 'react';

const HeroSection = () => {
  return (
    <section className="bg-blue-100 py-20">
      <div className="container mx-auto text-center">
        <h1 className="text-5xl font-bold mb-4">Streamline Your Job Application Process with Drop2Fill Extension</h1>
        <p className="text-xl mb-8">Simplify and Accelerate Your Job Applications</p>
        <div className="flex justify-center space-x-4">
          <button className="bg-black text-white px-6 py-3 rounded">Download Now</button>
          <button className="bg-blue-300 text-black px-6 py-3 rounded">Learn More</button>
        </div>
      </div>
    </section>
  );
};

export default HeroSection;
